    for (var i = 0; i < count; ++i) {
      features[i] = new ol.Feature({
        'geometry': new ol.geom.Point(
            ol.proj.fromLonLat([markers[i][6],markers[i][5]])),
        'i': i,
        'size': 2
      });
    }

    var styles = {
      '5': new ol.style.Style({
        image: new ol.style.Circle({
          radius: 5,
          fill: new ol.style.Fill({color: '#00FF00'}),
          stroke: new ol.style.Stroke({color: '#FFFFFF', width: 1})
        })
      }),
      '2': new ol.style.Style({
        image: new ol.style.Circle({
          radius: 2,
          fill: new ol.style.Fill({color: 'gray'}),
          stroke: new ol.style.Stroke({color: '#FFFFFF', width: 1})
        })
      })
    };

    var vectorSource = new ol.source.Vector({
      features: features,
      wrapX: false
    });

    var vector = new ol.layer.Vector({
      source: vectorSource,
      style: function(feature) {
        return styles[feature.get('size')];
      }
    });

    var map = new ol.Map({
      layers: [
        new ol.layer.Tile({source: new ol.source.Stamen({layer: 'watercolor',})}),
        new ol.layer.Tile({source: new ol.source.Stamen({layer: 'terrain-lines',})}),
        new ol.layer.Tile({source: new ol.source.Stamen({layer: 'terrain-labels',})}),
        vector],
      target: document.getElementById('map'),
      view: new ol.View({
        center: ol.proj.fromLonLat([0,0]),
        zoom: 3
      })
    });

    var point = null;
    var line = null;
    var displaySnap = function(coordinate) {
      var closestFeature = vectorSource.getClosestFeatureToCoordinate(coordinate);
      if (closestFeature === null) {
        point = null;
        line = null;
      } else {
        var geometry = closestFeature.getGeometry();

        info.innerText = markers[closestFeature.get('i')][0]//JSON.stringify(properties, null, 2);
        info.style.opacity = 1;
        
        var closestPoint = geometry.getClosestPoint(coordinate);
        if (point === null) {
          point = new ol.geom.Point(closestPoint);
        } else {
          point.setCoordinates(closestPoint);
        }
        if (line === null) {
          line = new ol.geom.LineString([coordinate, closestPoint]);
        } else {
          line.setCoordinates([coordinate, closestPoint]);
        }
      }
      map.render();
    };

    map.on('pointermove', function(evt) {
      if (evt.dragging) {
        return;
      }
      var coordinate = map.getEventCoordinate(evt.originalEvent);
      displaySnap(coordinate);
    });

    map.on('click', function(evt) {
      displaySnap(evt.coordinate);
      var coordinate = map.getEventCoordinate(evt.originalEvent);
      var closestFeature = vectorSource.getClosestFeatureToCoordinate(coordinate);
      info.innerText = markers[closestFeature.get('i')][0];
      document.querySelector(".modal-img").src = "https://ipfs.blockfrost.dev/ipfs/"+IPFS[closestFeature.get('i')];
      const myModal = new bootstrap.Modal(document.getElementById('gallery-modal'));
      myModal.show();
      var asset = document.getElementById('AN');
      asset.innerHTML=markers[closestFeature.get('i')][0];
      var poolpm=document.getElementById('POOLPM');
      if(closestFeature.get('i')>9999){
        poolpm.href="https://pool.pm/03928bd24b6afb832bf94503c73f8e46380e7c32b6ec3907ca100adb."+markers[closestFeature.get('i')][0];
      }else{
        poolpm.href="https://pool.pm/e09e4f4217669b7f735b7a3724e835d8d6344db128eb03d6ea72885e."+markers[closestFeature.get('i')][0];
      }
      var pais = document.getElementById('PAIS');
      pais.innerHTML="Country: "+markers[closestFeature.get('i')][9];
      var spec = document.getElementById('SPEC');
      spec.innerHTML="Species: "+markers[closestFeature.get('i')][8];
      var abun = document.getElementById('ABUN');
      abun.innerHTML="Abundance: "+markers[closestFeature.get('i')][1];
      var envi = document.getElementById('ENVI');
      envi.innerHTML="Environment: "+markers[closestFeature.get('i')][2];
      var flow = document.getElementById('FLOW');
      flow.innerHTML="Flowers: "+markers[closestFeature.get('i')][3];
      var frui = document.getElementById('FRUI');
      frui.innerHTML="Fruits: "+markers[closestFeature.get('i')][4];
      var lalo = document.getElementById('LALO');
      lalo.innerHTML="Lat/Long: "+markers[closestFeature.get('i')][5]+" / "+markers[closestFeature.get('i')][6];      
    });

    var stroke = new ol.style.Stroke({
      color: 'rgba(255,0,0,0.9)',
      width: 3
    });
    var style = new ol.style.Style({
      stroke: stroke,
      image: new ol.style.Circle({
        radius: 5,
        stroke: stroke
      })
    });

    map.on('postcompose', function(evt) {
      var vectorContext = evt.vectorContext;
      vectorContext.setStyle(style);
      if (point !== null) {
        vectorContext.drawGeometry(point);
      }
      if (line !== null) {
        vectorContext.drawGeometry(line);
      }
    });

    map.on('pointermove', function(evt) {
      if (evt.dragging) {
        return;
      }
      var pixel = map.getEventPixel(evt.originalEvent);
      var hit = map.hasFeatureAtPixel(pixel);
      if (hit) {
        map.getTarget().style.cursor = 'pointer';
      } else {
        map.getTarget().style.cursor = '';
      }
    });

    function ChCh(checkboxElem,auxtext) {
      if (checkboxElem.checked) {
        for (var i = 0; i < count; ++i) {
          if(markers[i][8]+markers[i][7]==auxtext){features[i].setStyle(styles['5'])};
        }
      }else{
        for (var i = 0; i < count; ++i) {
          if(markers[i][8]+markers[i][7]==auxtext){features[i].setStyle(styles['2'])};
        }
      }
    }

  function FiltroPais() {
    var x = document.getElementById("SelectPais").value;
    for (var i = 0; i < count; ++i) {
      if(markers[i][9]!==x && x!=="All"){
          features[i].setStyle(styles['2']
        )}else{
          auxtext=["AlonzoOne","AlphaOne","BetaOne","BetaTwo","GammaOne","GammaTwo","DeltaOne","DeltaTwo","DeltaThree","EpsilonOne","EpsilonTwo","EpsilonThree"];
          idaux=["AlonzoCh","AlphaCh","BetaCh1","BetaCh2","GammaCh1","GammaCh2","DeltaCh1","DeltaCh2","DeltaCh3","EpsilonCh1","EpsilonCh2","EpsilonCh3"];
          for (var j = 0; j < auxtext.length; ++j) {
            if (document.getElementById(idaux[j]).checked){
              if(markers[i][8]+markers[i][7]==auxtext[j]){features[i].setStyle(styles['5'])};
            }else{
              if(markers[i][8]+markers[i][7]==auxtext[j]){features[i].setStyle(styles['2'])};
            }
          };
        };
    }
  }

  </script>
